import React, { Component } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";

class Orderitem extends Component {
  render() {
    const { order } = this.props;
    return (
      <tr className="even pointer">
        <td className="a-center ">{order.cmdDate}</td>
        <td className="a-center ">{order.cmdNum}</td>
        <td className="a-center ">{oder.total}</td>
        <td className="a-center ">{oder.client}</td>
        <td className="a-center ">{oder.bill}</td>
        <td className="a-center ">{oder.products}</td>

        <td>
          <Link>Modify</Link> <br />
          <Link> Delete</Link>
        </td>
      </tr>
    );
  }
}

export default connect(null, {})(Orderitem);
